@pksunkara At least for me exactly the same error message is generated:

```rust
use diesel::prelude::*;

table! {
    foos {
        id -> Integer,
    }
}

#[derive(Insertable)]
struct Foo {
    #[diesel(column_name = "type")]
    ty: String,
}

```

generates

```
error: proc-macro derive panicked
 --> src/main.rs:9:10
  |
9 | #[derive(Insertable)]
  |          ^^^^^^^^^^
  |
  = help: message: expected identifier
```

the problem is likely this line of code: https://github.com/diesel-rs/diesel/blob/8d64a4011bed57851e3cd747df6d855d44ab9993/diesel_derives/src/attrs.rs#L99

Oh, I was trying out the deprecated derive format. IIRC a different error message came up.


```rust
use diesel::prelude::*;

table! {
    foos {
        id -> Integer,
    }
}

#[derive(Insertable)]
struct Foo {
    #[column_name = "type"]
    ty: String,
}
```

```
warning: #[column_name] attribute form is deprecated
  = help: use `#[diesel(column_name = type)]` instead

error: expected string literal
  --> src/main.rs:11:21
   |
11 |     #[column_name = "type"]
   |                     ^^^^^^
```
